import axios from 'axios';
import React, { useEffect, useState } from 'react';

const User2 = () => {
  const [User, SetUser] = useState([]);

  useEffect(() => {
    axios
      .get('http://localhost:4000/userall',
      )
      .then((response) => {
        SetUser(response.data);
      })
      .catch((error) => {
        alert('login failed');
        console.log(error);
      });
  });
  return <>
  {
    User.map((curElem)=>{
        return(
            <>
            {curElem.usename}
            {curElem.password}
            {curElem.userType}
            {curElem.email}
            <img src={'http://localhost:4000/'+curElem.avatar} />
            </>
        )
    })
  }
  </>;
};

export default User2;
